import './Header.css';

export default () => {
  return (
    <header>
      <div className="header-logo">
        <a href="/">
          <img src="https://fontmeme.com/permalink/211106/b984f4042d72ae3a3a0b9f4e0b1e990b.png" href="Netflix"></img>
        </a>
      </div>
    </header>
  );
}
